import { Component, OnInit } from '@angular/core';
import { ObtenerService } from 'src/app/services/obtener.service';

import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-cotizador',
  templateUrl: './cotizador.component.html',
  styles: []
})

export class CotizadorComponent implements OnInit {

  nombre = '';
  estudios: any[] = [];

  estudiosFilter: any[] = [];

  estudiosSeleccionados: any[] = [];
  costoEstudios: number = 0;

  constructor(private obtener: ObtenerService) {}

  ngOnInit() {
    this.obtener.estudiosChanged.subscribe(response => {
      this.estudios = response;
      this.estudiosFilter = response;
    });
    this.estudios = this.obtener.getEstudiosArray();
    this.estudiosFilter = this.obtener.getEstudiosArray();


  }

  setNameClient( nombre: string = '' ) {
    this.nombre = nombre.toUpperCase();
  }

  filterByName( param: string ) {
    if ( param ) {
      this.estudiosFilter = this.estudios.filter( (estudio: any) => {
        return this.getStringLimpio(estudio.nombre).includes(this.getStringLimpio(param.toUpperCase()));
      });
    } else {
      this.estudiosFilter = this.obtener.getEstudiosArray();// [];
    }
  }

  getStringLimpio( cadena: string ): string {
    return cadena.normalize('NFD').replace(/([^n\u0300-\u036f]|n(?!\u0303(?![\u0300-\u036f])))[\u0300-\u036f]+/gi, '$1')
    .normalize();
 }

  agregarEstudio( estudio: any ) {
    this.costoEstudios += estudio.precio;
    this.estudiosSeleccionados.push({  ... estudio });
  }

  removerEstudio( id_estudio: number ) {
    this.costoEstudios -= this.estudiosSeleccionados.filter(
      estudio => { if (estudio.id_estudio === id_estudio) { return estudio; } } )[0].precio;
    this.estudiosSeleccionados = this.estudiosSeleccionados.filter( estudio => {
      if (estudio.id_estudio !== id_estudio){
        return estudio;
      }} );
  }

  crearPdf() {
    pdfMake.createPdf(this.disenoPDF()).open();
  }

  imprimirPdf() {
    pdfMake.createPdf(this.disenoPDF()).print();
  }

  getArrayListPDF(data, columns) {
    const cuerpo = [];
    cuerpo.push(columns);
    for (let i = 0; i < data.length; i++) {
      const dataRow = [];
      dataRow.push(data[i].nombre);
      dataRow.push(data[i].condiciones);
      dataRow.push({ text: `$${data[i].precio}`, alignment: 'center'});
      cuerpo.push(dataRow);
    }
    return cuerpo;
  }

  public table(data, columns) {
    return {
      table: {
        headerRows: 1,
        widths: [ '*', '*', 100 ],
        body: this.getArrayListPDF(data, columns)
      }
    };
  }

  disenoPDF() {
    return {
      pageSize: 'LETTER',
      pageOrientation: 'landscape',
      pageMargins: [ 40, 60, 40, 60 ],
      content: [{
        columns: [{
          image: 'data:image/png;base64,',
          width: 130
        }, {
          text: ['COTIZACIÓN ESTUDIOS DE LABORATORIO\n\n', {text: `PACIENTE: ${ this.nombre }\n\n\n\n`  , style: 'nombreStyle' }],
          width: '*',
          style: 'centerTexto',
        }],
      },[
        this.table(this.estudiosSeleccionados, [{ text: `NOMBRE`, style: 'headerTable'}, { text: `CONDICIONES`, style: 'headerTable'},{ text: `PRECIO`, style: 'headerTable'}])
      ],[
        { text: `\nTOTAL: $${ this.costoEstudios }`, style: 'styleTotal' }
      ]
    ],
      styles: {
        centerTexto: {
          alignment: 'center',
          fontSize: 15,
          bold: true
        },
        nombreStyle: {
          bold: false,
          fontSize: 14
        },
        headerTable: {
          bold: true,
          fontSize: 13,
          alignment: 'center'
        },
        styleTotal: {
          bold: true,
          fontSize: 15,
          alignment: 'right'
        }
      }
    };
  }
}
